              headers: {
                "X-RapidAPI-Key": "your-api-key",
                "X-RapidAPI-Host": "jokes-by-api-ninjas.p.rapidapi.com",
              },
            })
              .then((response) => response.json())
              .then((data) => {
                setJoke(data[0].joke);
                console.log(data);
              })
              .catch((error) => console.log(error));
          }, []);

        return (<p>Testing</p>);
    }
}

